import React from "react";
import PropTypes from "prop-types";
import { Row, Col } from "antd";
import AppHeader from "./AppHeader";

const AppLayout = ({ children }) => {
  return (
    <>
      <header>
        <AppHeader />
      </header>

      <Row>
        <Col xs={0} sm={4}>
          Left
        </Col>
        <Col xs={24} sm={16}>
          {children}
        </Col>
        <Col xs={0} sm={4}>
          Right
        </Col>
      </Row>
    </>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
